import React from "react";
import "./Navbar.css";

const Navbar = () => {
  return (
    <div className="Navbar">
      <ul className="nav-menu" style={{ cursor: "pointer" }}>
        <li><a style={{color:"white",fontSize:"30px",textDecoration:"none"}} href="/">Home</a></li>
        <li><a style={{color:"white",fontSize:"30px",textDecoration:"none"}} href="/about">About Me</a></li>
        <li><a style={{color:"white",fontSize:"30px",textDecoration:"none"}} href="/services">Services</a></li>
        <li><a style={{color:"white",fontSize:"30px",textDecoration:"none"}} href="/work">Portfolio</a></li>
        <li><a style={{color:"white",fontSize:"30px",textDecoration:"none"}} href="/contact">Contact</a></li>
      </ul>
      <div className="nav-connect"><a style={{color:"white",fontSize:"30px",textDecoration:"none"}} href="/contact">Connect With Me</a></div>
    </div>
  );
};

export default Navbar;
